#include <cstdint>
#include <unordered_map>
#include <set>

typedef uint64_t obj_id_t;

// GDSF-inspired cache: frequency/size, with recency for tie-break, evicts lowest priority
class CacheManager {
private:
    struct Node {
        obj_id_t id;
        uint64_t freq;
        uint64_t time;
        uint64_t size;
        double priority;
        Node(obj_id_t i, uint64_t f, uint64_t t, uint64_t s, double p)
            : id(i), freq(f), time(t), size(s), priority(p) {}
        bool operator<(const Node& o) const {
            if (priority != o.priority) return priority < o.priority;
            if (time != o.time) return time < o.time;
            return id < o.id;
        }
    };
    std::unordered_map<obj_id_t, std::set<Node>::iterator> lookup;
    std::set<Node> pq;
    uint64_t tick = 0;
    double last_evict_priority = 0.0;

    double calc_priority(uint64_t freq, uint64_t size) {
        // scale factor boosts freq/size impact
        if (size == 0) return last_evict_priority + freq * 1e6;
        return last_evict_priority + (double(freq) * 1e6 / size);
    }

public:
    bool find(obj_id_t obj_id) {
        auto it = lookup.find(obj_id);
        if (it == lookup.end()) return false;
        Node old_node = *(it->second);
        pq.erase(it->second);
        uint64_t new_freq = old_node.freq + 1;
        double pri = calc_priority(new_freq, old_node.size);
        Node upd(old_node.id, new_freq, ++tick, old_node.size, pri);
        auto iter = pq.insert(upd).first;
        lookup[obj_id] = iter;
        return true;
    }

    void insert(obj_id_t obj_id, uint64_t obj_size) {
        if (lookup.count(obj_id)) {
            find(obj_id);
            return;
        }
        double pri = calc_priority(1, obj_size);
        Node n(obj_id, 1, ++tick, obj_size, pri);
        auto iter = pq.insert(n).first;
        lookup[obj_id] = iter;
    }

    obj_id_t evict() {
        if (pq.empty()) return 0;
        auto victim = pq.begin();
        obj_id_t vid = victim->id;
        last_evict_priority = victim->priority;
        pq.erase(victim);
        lookup.erase(vid);
        return vid;
    }
};
